package me.surendra.leetcode.string;

import com.google.common.collect.Lists;
import org.junit.Test;

import java.util.Arrays;

import static me.surendra.leetcode.string.Anagram.checkInclusion;
import static me.surendra.leetcode.string.Anagram.findAnagrams;
import static me.surendra.leetcode.string.Anagram.longestCommonPrefix;
import static me.surendra.leetcode.string.Anagram.minStepsToMake2StringAnagram;
import static org.hamcrest.Matchers.equalTo;
import static org.junit.Assert.assertThat;

// https://leetcode.com/problems/minimum-number-of-steps-to-make-two-strings-anagram/
public class AnagramTest {

    @Test
    public void minStepsToMake2StringAnagramTest() {
        assertThat(minStepsToMake2StringAnagram("bab", "aba"), equalTo(1));
        assertThat(minStepsToMake2StringAnagram("leetcode", "practice"), equalTo(5));
        assertThat(minStepsToMake2StringAnagram("anagram", "mangaar"), equalTo(0));
        assertThat(minStepsToMake2StringAnagram("xxyyzz", "xxyyzz"), equalTo(0));
        assertThat(minStepsToMake2StringAnagram(
            "",
            ""),
            equalTo(50000));
    }

    @Test
    public void findAllAnagramsInAString() {
        assertThat(findAnagrams("cbaebabacd", "abc"), equalTo(Lists.newArrayList(0, 6)));
        assertThat(findAnagrams("abab", "ab"), equalTo(Lists.newArrayList(0, 1, 2)));
        assertThat(findAnagrams("abab", "aba"), equalTo(Lists.newArrayList(0)));
    }

    @Test
    public void isPermutationInString() {
        assertThat(checkInclusion("ab", "eidbaooo"), equalTo(true));
        assertThat(checkInclusion("ab", "eidboaoo"), equalTo(false));
    }

    @Test
    public void getLongestCommonPrefix() {
        assertThat(longestCommonPrefix(new String[]{"flower","flow","flight"}), equalTo("fl"));
        assertThat(longestCommonPrefix(new String[]{"dog","racecar","car"}), equalTo(""));
        assertThat(longestCommonPrefix(new String[]{"dog"}), equalTo("dog"));
        assertThat(longestCommonPrefix(new String[]{"aca","cba"}), equalTo(""));
        assertThat(longestCommonPrefix(new String[]{}), equalTo(""));
    }

}
